import React , { useState, useEffect } from 'react'

const MoviesList = () => {
    const [movieList, setMovieList] = useState([]);
    const keyAPI = 'fa3015aa3c35912635c7d973c01a9364'

    useEffect(()=>{
        fetch(`https://api.themoviedb.org/3/search/multi?include_adult=false&page=1&query=pixar&language=en-US&api_key=${keyAPI}`)
        .then(function(response) {
            return response.json();
          })
          .then(data => {
              setMovieList(data.results)
          });

        // .then(movieList =>{
        //     setMovieList(movieList)
        // }
        // )
    }, [])
    if (!movieList) return ("")


    return ( 
        //aqui NO me salen los resultados
        <div>
            {movieList.map(movieItem=> console.log(movieItem)||(
             <div key={movieItem.id}>
             <h3>{movieItem.id}</h3>   
             <h2>{movieItem.name}</h2>
            </div>))}
        </div> 
        );
}

export default MoviesList;
